      >
        <Nav />
        <main style={{ marginTop: 64, textAlign: 'center' }}>
          <Switch>
            <Route path="/" exact component={Home} />
            <Route path="/login" component={Login} />
            <Route path="/logout" component={Logout} />
            <Route path="/profile" component={Profile} />
          </Switch>
        </main>

      </Container>
    </Router >

  );
}

export default App;
